import React, { useState } from "react";

function BookForm() {

    const [user, setUser] = useState({
        email: "",
        password: "",
        image: ""
    })

    function handleChange(event) {
        const { name, value } = event.target;
        setUser({ ...user, [name]: value });
    }

    function handleSubmit(event) {
        event.preventDefault();
        console.log(user);
    }

    return (
        <form onSubmit={handleSubmit}>
            <div class="form-group" >
                <label for="exampleInputEmail1">Email address</label>
                <input type="email" name="email" onChange={handleChange} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" />
                <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
            </div>
            <div class="form-group">
                <label for="exampleInputPassword1">Password</label>
                <input type="password" name="password" onChange={handleChange} class="form-control" id="exampleInputPassword1" placeholder="Password" />
            </div>

            <div class="form-group">
                <label class="form-label" for="customFile">Default file input example</label>
                <input type="file" name="image" onChange={handleChange} class="form-control" id="customFile" />
            </div>
            <button type="submit" class="btn btn-primary">Submit</button>
        </form>
    );
}

export default BookForm;
